<p>变量的“生命”指的是变量的有效范围，也就是从变量创建开始，到变量离开作用域结束。一个值（或变量）“活着”，就是它还在作用域内，尚未被释放（还没被 drop）。
而当变量离开作用域或被提前释放，我们就说它“死了”</p>
